import React from "react";

const Entryheading = (props) => {
  return (
    <div>
      <h1>{props.heading}</h1>
      <p>{props.description}</p>
    </div>
  );
};

const UserEntries = (props) => {
  //   console.log(props.entries);
  return (
    <div>
      {props.entries.map((userEntry) => {
        return (
          <ul className="user-entries">
            <li>
              <p>
                {entries[0].userName}
                <span>{entries[1].price}</span>
              </p>
              <p>{entries[2].additionalInfo}</p>
              <p>{entries[3].dateIssue}</p>
            </li>
          </ul>
        );
      })}
    </div>
  );
};

const CycleEntries = ({ basicEntries }) => {
  return (
    <div>
      {basicEntries.map((entry) => {
        return (
          <div className="wrap-entries">
            <Entryheading
              heading={entry.entryHeading}
              description={entry.dateRange}
            />
            <UserEntries entries={entry.userEntries} />
          </div>
        );
      })}
    </div>
  );
};

export default CycleEntries;
